import React from "react";
import { Link } from "react-router-dom";
import myImage from './'


function Nav() {
  return (
    <nav className="navbar navbar-expand-lg custom-navbar">
      <div className="container-fluid">
        {/* Logo */}
        <div className="navbar-logo">
          <img src="file:///home/mbuks/Downloads/DALL%C2%B7E%202024-11-11%2019.25.10%20-%20A%20beautiful%20logo%20design%20for%20'Musas%20Electronic%20Shop'%20with%20a%20modern,%20clean,%20and%20sleek%20look.%20The%20logo%20includes%20the%20text%20'Musas%20Electronic%20Shop'%20in%20a%20bold.webp" alt="Musas Electronic Shop Logo" className="logo-image" />
        </div>

        {/* Title */}
        <div className="navbar-brand">
          <span>Musas Electronic Shop</span>
        </div>

        {/* Navigation Links */}
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item">
              <Link className="nav-link" to="/">Home</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/About">About</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link" to="/Cart">Cart</Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default Nav;
